// a component which we can access it with/without user login. By default we’ll open this component.


import React from 'react'
import Banner from "./components/Banner";
import bg2 from './Image/bg3.jpg'
import bg4 from './Image/bg4.jpg'



// The stracture of fullpage for Home.js

function Home() {
  return (
    <main>
    <div className="asdkl">
    <Banner css='banner1' />
    <img src={bg2} alt="bg3" className="bg3"/>
    <img src={bg4} alt="bg3" className="bg4"/>
    </div>
    </main>
  );
}


export default Home;
